import React from 'react';
import logo from './logo.svg';
import './App.css';

import JsonTable from './GenTable';
import JavaCodeAnalyzer from "./scan-java"
import Diagram from "./draw-class-diagram"
import ClassEditor from "./use-input-form"
import componentDiagram from "./component-diagram.plantuml";
import { BrowserRouter as Router } from "react-router-dom";



const pages = [
  {
    path: "/",
    diagram: `@startuml
    Class01 <|-- Class02
    Class03 *-- Class04
    Class05 o-- Class06
    Class07 .. Class08
    Class09 -- Class10
    @enduml`,
    title: "Sequence Diagram",
  }
];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <JsonTable/>
        {/* <JavaCodeAnalyzer/> */}
        <Router>
          {pages.map((page) => (
            <Diagram
              key={page.path}
              path={page.path}
              diagram={page.diagram}
              title={page.title}
              pages={pages}
            />
          ))}
        </Router>
        {/* <ClassEditor/> */}
      </header>
    </div>
  );
}

export default App;
